import React from "react";
import TextField from "@material-ui/core/TextField";
import { createStyles, makeStyles, Theme } from "@material-ui/core/styles";

interface props {
    idValue: string;
    label: string;
}

const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            "& .MuiTextField-root": {
                margin: theme.spacing(1),
                width: "25ch",
            },
        },
    })
);

export default function FormPropsTextFields(props: props) {
    const classes = useStyles();

    let textField= <TextField id="standard-basic" label={props.label} />;
    if (props.idValue == "required") {
        textField = <TextField required id="standard-required" label={props.label} />;
    } else {
        textField = <TextField id="standard-basic" label={props.label} />;
    }

    return (
        // <form className={classes.root} noValidate autoComplete="off">
        { textField }
        // </form>
    );
}
